e44-8821-c1064fb261c9","name":"text_block","title":"Text Block","visibility":true,"settings":{"text":"<p>This webinar presented the latest understanding and state of the science on tropical cyclones and climate change and their relevance to risk in Florida. Jake discusses the impacts from recent destructive storms, and provides an overview of tropical cyclone data collection and data availability that drives forecasting and modeling. He describes the changes observed in tropical cyclone activity and how tropical cyclone activity may change in the future. Jake is a two-time alumnus of Florida State’s meteorology program, earning his Bachelor of Science in 2017 and a Master of Science in 2019. Under the advisement of Dr. Allison Wing, his current research intertwines two major elements of tropical weather and climate: hurricanes and thunderstorms. He uses high-resolution models to study the complex interactions between tropical clouds and their surrounding environment, and he examines the tendency for convection to “self-organize” and the physics of tropical cyclone formation from this framework. He has served as a Producer and on-air talent for the student-led “FSU Weather” television show, and he was the President of the North Florida Chapter of the American Meteorological Society and National Weather Association in 2019-2020, winning the 2020 AMS Chapter of the Year Award.</p>","title":"","heading_selector":"h3","title_typography":{"font":"","size":{"xl":{"value":"","unit":"px"},"lg":{"value":"","unit":"px"},"md":{"value":"","unit":"px"},"sm":{"value":"","unit":"px"},"xs":{"value":"","unit":"px"}},"line_height":{"xl":{"value":"","unit":"px"},"lg":{"value":"","unit":"px"},"md":{"value":"","unit":"px"},"sm":{"value":"","unit":"px"},"xs":{"value":"","unit":"px"}},"letter_spacing":{"xl":{"value":"0","unit":"px"},"lg":{"value":"","unit":"px"},"md":{"value":"","unit":"px"},"sm":{"value":"","unit":"px"},"xs":{"value":"","unit":"px"}},"uppercase":"","italic":"","underline"