4aa441-6539-44d5-aab2-dcac667c23b5","name":"text_block","title":"Text Block","visibility":true,"settings":{"text":"<p>Differences in life expectancy rates between neighborhoods, can in part, be attributed to the social determinants of health, or local conditions where people work, live, and age. Characteristics of local residents such as race/ethnicity, socioeconomic status, housing status, household structure, and retirement status have established links to health. This study moves beyond prior research to include more specific factors such as access to an automobile, living in mobile homes, persons per household, recipients of Social Security benefits, and female-headed households. These social vulnerability indicators are drawn from a public health dataset detailing factors meant to indicate which individuals are at risk to be harmed by natural and/or human caused disasters in Florida. In this webinar, graduate student Bertram Melix will discuss the results of a study designed to identify and evaluate how community-based risk factors contribute to differences in life expectancy rates across neighborhoods in Florida.</p>","instFormId":"cb1f8d27-6aef-4122-b250-0509d79d58bd","title_url":{"url":"","type":"url","new_tab":false,"nofollow":false,"noreferrer":false,"noopener":false},"btn_url":{"url":"","type":"url","new_tab":false,"nofollow":false,"noreferrer":false,"noopener":false},"text_typography":{"font":"","size":{"xl":{"value":"","unit":"px"},"lg":{"value":"","unit":"px"},"md":{"value":"","unit":"px"},"sm":{"value":"","unit":"px"},"xs":{"value":"","unit":"px"}},"line_height":{"xl":{"value":"","unit":"px"},"lg":{"value":"","unit":"px"},"md":{"value":"","unit":"px"},"sm":{"value":"","unit":"px"},"xs":{"value":"","unit":"px"}},"letter_spacing":{"xl":{"value":"","unit":"px"},"lg":{"value":"","unit":"px"},"md":{"value":"","unit":"px"},"sm":{"value":"","unit":"px"},"xs":{"value":"","unit":"px"}},"uppercase":false,"italic":false,"underline":false,"weight":"","type":"goog