352-d799-4443-95b6-97bcea921144","name":"text_block","title":"Text Block","visibility":true,"settings":{"text":"<p>Evaluation is an important component of any program's development, but it is often an afterthought or neglected when an agency has many other pressing priorities. But the systematic collection of information about activities, characteristics, and outcomes of programs can be used to make judgements about the program, improve program effectiveness, and/or inform decisions about future program development. Looking at evaluation specifically through the lens of public health, the CDC defines it as "a systematic way to improve and account for public health actions by involving procedures that are useful, feasible, ethical, and accurate." In an effort to focus on building the capacity of public health departments and to get health officials and community partners thinking about evaluation before The 45-minute presentation,co-presented by Drs. Tisha Holmes and Ava Holt, covers the basics of evaluation, the evaluation life cycle, and evaluation components using a real-world example. In addition to providing a good primer on evaluation, the evaluation webinar was developed to support the funding opportunity announcement presently in circulation to public health departments and community partners.</p>","instFormId":"fc2f80ad-3d5c-4728-9430-787550b01374","title_text_shadow":{"ho":null,"vo":null,"blur":null,"spread":null,"color":"","inset":false,"enabled":false},"title_link":{"url":"","type":"url","new_tab":false,"nofollow":false,"noreferrer":false,"noopener":false},"text_typography":{"font":"","size":{"xl":{"value":"","unit":"px"},"lg":{"value":"","unit":"px"},"md":{"value":"","unit":"px"},"sm":{"value":"","unit":"px"},"xs":{"value":"","unit":"px"}},"line_height":{"xl":{"value":"","unit":"px"},"lg":{"value":"","unit":"px"},"md":{"value":"","unit":"px"},"sm":{"value":"","unit":"px"},"xs":{"value":"","unit":"px"}},"letter_spacing":{"xl":{"value":"","unit":"px"},"lg"